import React from "react";
import Input from "../components/Input";

function Login() {
    return (
        <div className="form">
            <form >
            <div className="brand">Transfy</div>
            <Input label="E-mail" type="text" placeholder="Entrer votre e-mail" />
            <Input label="Mot de passe" type="password" placeholder="Entrer votre mot de passe" />
            <button type="submit">Se connecter</button>
        </form>
        <p>Vous n'avez pas un compte? <a href="#">S'inscrir</a> </p>
        </div>
    );
}

export default Login;
